import React from 'react';
import { Grid, Card, CardActionArea, CardMedia, Typography } from "@material-ui/core";

const FilmCard = (props) => {
    return (
        <div>
            <Card>
                <CardActionArea>

                    <CardMedia image={props.info.img} >
                    </CardMedia>
                    <Typography variant="subtitle1"> {props.info.title} </Typography>
                </CardActionArea>
            </Card>
        </div>
    )
}

export default FilmCard;
